import React from 'react';
import {  Link } from "react-router-dom";
const navbar= () =>{
  return (
  <div>
    <li>
      <Link to="/">Home</Link>
    </li>
    <li>
      <Link to="/tool">Tool</Link>
    </li>
    <li>
      <Link to="/faqs">FAQs</Link>
    </li>
    <li>
      <Link to="/contact">Contact</Link>
    </li>
  </div>
  );
}
export default navbar;
